import {Route, Routes} from 'react-router-dom';
import './App.css';
import landing from "./pages/landing/landing.js";

function App() {
  return (
    <div className="app-container">
      <navbar />
      <div className = "main-content">
        <Routes>
          <Route path= "/" element = {<landing />} />

        </Routes>
      </div>


    </div>
  );
}

export default App;
